import portrait1 from "../images/portrait1.png"

const Topfive = () => {
    return (
        <div className='topfive'>
            <div className='user'>
                <img alt='top-result' src={portrait1} width='100%' height='100%' style={{ objectFit : 'cover' }}/>
            </div>
        </div>
    )
}

export default Topfive
